import{_ as a,p as c,q as s,s as e,R as t}from"./framework-823c4b5a.js";const o={},n=e("h1",{id:"刚刚踏入二十岁的一些感想",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#刚刚踏入二十岁的一些感想","aria-hidden":"true"},"#"),t(" 刚刚踏入二十岁的一些感想")],-1),d=e("p",null,[t("前几天迎来了自己的20岁生日，趁着这个机会也对大学以来的自己做一个总结以及展望。 "),e("img",{src:"https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/1732d709d0c24b8789dd2d1f85a0603c~tplv-k3u1fbpfcp-watermark.image?",alt:"4e262902cde9b32eedfd4d62c2c4a15.jpg"})],-1),_=e("p",null,"我们学校是广东某双非双一流一本，大一上的课程比较少，专业课就C语言和高数，可惜当时没有早早地开始了解计算机发展的方向，那个学期和寒假也就算是草草度过了（好像也不能说草草度过了，毕竟前期打基础最重要嘛）。编程基础学的倒还是不错，算是为之后打下了一些基础。期间还加入到了校级组织的技术部，符合当时我对ps、pr的兴趣点，算是干了一个学期自己感兴趣的事情。",-1),l=e("p",null,"大一下一开始大家都开始热衷于各种算法竞赛，包括校赛、acm之类的，我也凑了几次热闹，浅浅经历了竞赛的毒打后果断放弃了往竞赛方向发展的念头。后来院内有举办轻应用的开发大赛，老师在讲解具体开发流程的过程中提到了所谓前后端分离的概念。因为自己对于数据没有那么敏感，对可视化的东西更感兴趣，所以当时选择开始学习前端。得益于前端入门门槛相对低以及页面效果带来的正反馈，那个暑假我基本上把HTML+CSS+JS过了一遍，也决定开始往这条路走一走。",-1),p=e("p",null,[e("img",{src:"https://p1-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/1a6e6a49211d44ada0aa496f4142b6b4~tplv-k3u1fbpfcp-watermark.image?",alt:"wallhaven-zyz25o.jpg"})],-1),i=e("p",null,"大二上学期，此时还处于疫情防控时期，各种就业考研的焦虑从四面八方传来，我也想着有没有一些渠道能为自己积累一些实战经验，最后靠着自己的半桶水的知识进到了老师的工作室中。这个学期也入门了Vue，跟着b站做了个经典的商城项目。后面广州疫情爆发，十二月份就回到家里，一下子放假放到了23年的2月。这期间应该是我前端水平提高最多的一个阶段，开始接触到了许多工程化的知识，学习方式也从看视频转换到了看社区、看文档，没事就逛逛各种大佬的博客，收获到许多自己不懂的知识。",-1),r=e("p",null,"当你对你个行业了解越深，这个行业在你眼里就会暴露出越多的问题。大二下开始疫情接触，然而就业的情况似乎并没有变得乐观起来，某音、某站等等平台都在说今年的互联网开始走下坡路了，Java、前端、测试等等互联网的一个岗位有几百份简历投过来。网络上的声音很大，说不焦虑都是假的，包括我女朋友学国贸想转码我也是反对的。我也开始重新审视自己，所谓一昧地去追求新技术有那么大的意义吗？尤其是对于前端来说，除了那几个大框架，很多技术都是需要的时候再去看文档学习。自己的学习时期的核心不应该局限在那几个框架的熟悉程度之中，自己应该去见识更多的东西，打好专业的基础。专攻一个岗位拿大厂offer的时代已经一去不复返了，此时更应该让自己跳出舒适区见识更多、更广。",-1),f=e("p",null,"最后，愿诸君共勉。",-1),h=[n,d,_,l,p,i,r,f];function u(m,b){return c(),s("div",null,h)}const k=a(o,[["render",u],["__file","01.html.vue"]]);export{k as default};
